// initializes and ensures everything is safe to use
void initState()
{
   turn = 'x';
   btn_singlePlayer.redraw = 2;
   btn_twoPlayer.redraw = 2;
   returnToMenu.redraw = 2;
   btnRestart.redraw = 2;
   resetMouse();
   int buffT = buff;
   buff = 0;
   while (arrListOfPixels[0].count)
   {
      popPixel();
   }

   buff = 1;
   while (arrListOfPixels[1].count)
   {
      popPixel();
   }

   buff = buffT;

   memset((void*)charBase, '\0', 80*60*sizeof(char));
   savePixels = 0;
   newState();
   wait_vsync();

   newState();
   wait_vsync(); // draw on both buffers
}

// based on "gamestate", draws the background image and initializes all values
void newState()
{
   Point c = {320 / 2, 240 / 2};
   switch (gameState)
   {
   case START:


      draw_image(c, start_screen, WIDTH, HEIGHT, WIDTH, HEIGHT);
      break;
   case MODE_3D:
      BG = 0x8d70;

      // Set 3d grid (cells_normal) data
      for (int f = 0; f < 6; f++)
      {
         for (int r = 0; r < 3; r++)
         {
            for (int c = 0; c < 3; c++)
            {
               cells3D[f][r][c].width = cells3D[f][r][c].height = 50;
               cells3D[f][r][c].offsetx = cells3D[f][r][c].width * c + CELLS_X_START;
               cells3D[f][r][c].offsety = cells3D[f][r][c].height * r + CELLS_Y_START;
               cells3D[f][r][c].center.x = cells3D[f][r][c].offsetx + cells3D[f][r][c].width / 2;
               cells3D[f][r][c].center.y = cells3D[f][r][c].offsety + cells3D[f][r][c].height / 2;
               cells3D[f][r][c].center.z = cells_z[f];

               cells3D[f][r][c].redraw = 2;
               cells3D[f][r][c].occupied = '-';
               cells3D[f][r][c].clr = 0xef3b;
               cells3D[f][r][c].pieceDrawX = 0;
               cells3D[f][r][c].pieceDrawY = 0;
               cells3D[f][r][c].fCount = 0;
               cells3D[f][r][c].isHovered = 0;
               cells3D[f][r][c].initiatedHover = 0;

               cells3D[f][r][c].xRotation = cells_xRot[f];
               cells3D[f][r][c].yRotation = cells_yRot[f];
            }
         }
      }

      for (int x = 0; x < WIDTH; x++)
      {
         for (int y = 0; y < HEIGHT; y++)
         {
            clear_pixel(x, y, BG);
         }
      }
      break;
   case TWO_PLAYER:
      BG = 0x9306; // dark orange

      // Set 2d grid (cells_normal) data
      for (int r = 0; r < 3; r++)
      {
         for (int c = 0; c < 3; c++)
         {
            cells_normal[r][c].width = cells_normal[r][c].height = 50;
            cells_normal[r][c].offsetx = cells_normal[r][c].width * c + CELLS_X_START;
            cells_normal[r][c].offsety = cells_normal[r][c].height * r + CELLS_Y_START;
            cells_normal[r][c].center.x = cells_normal[r][c].offsetx + cells_normal[r][c].width / 2;
            cells_normal[r][c].center.y = cells_normal[r][c].offsety + cells_normal[r][c].height / 2;
            cells_normal[r][c].redraw = 2;
            cells_normal[r][c].occupied = '-';
            cells_normal[r][c].clr = 0xef3b; // light blue
            cells_normal[r][c].pieceDrawX = 0;
            cells_normal[r][c].pieceDrawY = 0;
            cells_normal[r][c].fCount = 0;
         }
      }
      //draw_image()
      for (int x = 0; x < WIDTH; x++)
      {
         for (int y = 0; y < HEIGHT; y++) 
         {
            clear_pixel(x, y, BG);
         }
      }
      break;
   case END:
      // if (winnerState == redWinner)
      //    draw_image(c, redWins, WIDTH, HEIGHT, WIDTH, HEIGHT);
      // else if(winnerState == blueWinner)
      //    draw_image(c, blueWins, WIDTH, HEIGHT, WIDTH, HEIGHT);
      break;
   default:
      break;
   }
}

