int drawButton32by32(ButtonGUI btn, const short int image[2][1024], enum GameStates GSifClkd){

   if (btn.redraw)
   {
      if (btn.isHovered)
      {
         draw_image(
               btn.loc,
               image[1],
               btn.width,
               btn.height,
               btn.width,
               btn.height);
         btn.redraw--;
      }
      else
      {
         draw_image(
               btn.loc,
               image[0],
               btn.width,
               btn.height,
               btn.width,
               btn.height);
         btn.redraw--;
      }
   }

   if (
         mouse.position.x >= btn.loc.x - btn.width / 2 &&
         mouse.position.x <= btn.loc.x + btn.width / 2 &&
         mouse.position.y >= btn.loc.y - btn.height / 2 &&
         mouse.position.y <= btn.loc.y + btn.height / 2)
   {
      if (!btn.isHovered)
      {
         btn.isHovered = 1;
         btn.redraw = 2;
      }

      if (mouse.wasLeft)
      {
         gameState = GSifClkd;
         winnerState = noWinner;
         initState();
         return 1;
      }
   }
   else if (btn.isHovered)
   {
      btn.isHovered = 0;
      btn.redraw = 2;
   }

   return 0;

}

void draw_cells()
{
   for (int r = 0; r < 3; r++)
   {
      for (int c = 0; c < 3; c++)
      {
         struct cell *cell = &cells_normal[r][c];
         short clr = 0xef3b;

         if (mouse.position.x > cell->offsetx &&
             mouse.position.x < cell->offsetx + cell->width &&
             mouse.position.y > cell->offsety &&
             mouse.position.y < cell->offsety + cell->height)
         {
            clr = cell->occupied != '-' ? 0xce37 : turn == 'x' ? 0xf470
                                                               : 0x7577; // 0xce37;

            if (cell->clr != clr)
            {
               cell->clr = clr;
               cell->redraw = 2;
            }
         }
         else if (cell->clr != clr)
         {
            cell->clr = clr;
            cell->redraw = 2;
         }

         if (cell->redraw)
         {
            savePixels = 0;
            draw_square(cell->center, cell->width, cell->height, clr);

            if (cell->occupied == 'x')
               draw_image(cell->center, piece_x, cell->pieceDrawX, cell->pieceDrawY, 40, 40);
            else if (cell->occupied == 'o')
               draw_image(cell->center, piece_o, cell->pieceDrawX, cell->pieceDrawY, 40, 40);
            savePixels = 1;

            if (cell->occupied != '-' && cell->pieceDrawX != 40 && cell->pieceDrawY != 40)
            {
               cell->redraw += 2;
               if (cell->fCount == 1)
               {
                  cell->pieceDrawX++;
                  cell->pieceDrawY++;
                  cell->fCount = 0;
               }
               else
               {
                  cell->fCount++;
               }
            }
         }
      }
   }

   for (int r = 0; r < 3; r++)
   {
      for (int c = 0; c < 3; c++)
      {
         struct cell *cell = &cells_normal[r][c];

         if (cell->redraw)
         {
            savePixels = 0;
            Point points[4] = {
                {cell->offsetx, cell->offsety},
                {cell->offsetx + cell->width, cell->offsety},
                {cell->offsetx + cell->width, cell->offsety + cell->height},
                {cell->offsetx, cell->offsety + cell->height}};

            for (int i = 1; i <= 4; i++)
            {
               draw_line(points[(i - 1) % 4], points[i % 4], 0x0000);
            }
            cell->redraw--;
            savePixels = 1;
         }
      }
   }
}

//Checks winner based on which box was just clicked
void checkPlaced(){
   int x = mouse.position.x;
   int y = mouse.position.y;
   // finds which box was placed
    int c = (x - CELLS_X_START) / 50;
    int r = (y - CELLS_Y_START) / 50;

    int winner = blueWinner;
   if (turn == 'x')
   {
      winner = redWinner;
   }

   // Check row or collumn // used for which piece was placed
   if ((cells_normal[r][(c + 1) % 3].occupied == turn &&
        cells_normal[r][(c + 2) % 3].occupied == turn
        /*cells_normal[r][(c + 3) % 3].occupied == turn*/) ||

       (cells_normal[(r + 1) % 3][c].occupied == turn &&
        cells_normal[(r + 2) % 3][c].occupied == turn
        /*cells_normal[(r + 3) % 3][c].occupied == turn*/))
   {
      winnerState = winner;
      return;
   }

      // // Check either diagonal
   if ((r == c && //ex 0 , 0
        cells_normal[(r) % 3][(c) % 3].occupied == turn         && // 0, 0
        cells_normal[(r + 1) % 3][(c + 1) % 3].occupied == turn && // 1, 1
        cells_normal[(r + 2) % 3][(c + 2) % 3].occupied == turn) ||// 2, 2
       // checks top left to bottom right

       (/*r + c == 2 &&*/ //ex: 2 , 0
        cells_normal[(r + 1) % 3][(c + 2) % 3].occupied == turn && // 0, 2
        cells_normal[(r + 2) % 3][(c + 1) % 3].occupied == turn && // 1, 1
        cells_normal[(r) % 3][(c) % 3].occupied == turn)) //2, 0
   // checks top right to bottom left
   {
      winnerState = winner;
      return;
   }

   // if no winner, check tie
   int isTie = 1;
   for (int i = 0; i < 3 && isTie; i++/*, printf("\n")*/)
   {
      for (int j = 0; j < 3; j++)
      {
         // printf("%c ", cells_normal[i][j].occupied);
         if (cells_normal[i][j].occupied == '-') //if any are empty
         { // if any are empty, no tie
            isTie = 0;
            break;
         }
      }
   }

   if (isTie)
   {
      winnerState = tie;
   }
   else{
      winnerState = noWinner; //final condition, no winner and no tie
   }
   
}

//checks winner based on an input of a grid. Useful for 3D
int checkWinner(struct cell grid[3][3], char val)
{
   int winner = blueWinner;
   if (val == 'x')
   {
      winner = redWinner;
   }

   for (int c = 0; c < 3; c++)
   {
      char foundWon = 1;

      for (int r = 0; r < 3; r++)
      {
         if (grid[r][c].occupied != val)
         {
            foundWon = 0;
            break;
         }
      }

      if (foundWon)
      {
         winnerState = winner;
         // gameState = END;
         // initState();
         return winner;
      }
   }

   for (int r = 0; r < 3; r++)
   {
      char foundWon = 1;

      for (int c = 0; c < 3; c++)
      {
         if (grid[r][c].occupied != val)
         {
            foundWon = 0;
            break;
         }
      }

      if (foundWon)
      {
         winnerState = winner;
         // gameState = END;
         // initState();
         return winner;
      }
   }

   char posDiag = 1, negDiag = 1;

   for (int i = 0; i < 3; i++)
   {
      if (grid[i][i].occupied != val)
         negDiag = 0;

      if (grid[2 - i][i].occupied != val) //2, 0 - 1, 1 - 0, 2
         posDiag = 0;
   }

   if (posDiag || negDiag)
   {
      winnerState = winner;
      // gameState = END;
      // initState();
      return winner;
   }

   // if no winner, check tie
   int isTie = 1;
   for (int i = 0; i < 3 && isTie; i++, printf("\n"))
   {
      for (int j = 0; j < 3; j++)
      {
         printf("%c ", grid[i][j].occupied);
         if (grid[i][j].occupied == '-')
         { // if any are empty, no tie
            isTie = 0;
            break;
         }
      }
   }

   if (isTie)
   {
      winnerState = tie;
      // gameState = END;
      // initState();
      return tie;
   }

   winnerState = noWinner;
   return noWinner;
}


