void draw_square(Point p, int width, int height, short clr)
{
   for (int x = p.x - width / 2; x <= p.x + width / 2; x++)
   {
      for (int y = p.y - height / 2; y <= p.y + height / 2; y++)
      {
         plot_pixel(x, y, clr);
      }
   }
}

void draw_circle(Point p, int r, short clr)
{
   for (int x = p.x - r; x <= p.x + r; x++)
   {
      for (int y = p.y - r; y <= p.y + r; y++)
      {
         if ((x - p.x) * (x - p.x) + (y - p.y) * (y - p.y) > r * r)
            continue;

         plot_pixel(x, y, clr);
      }
   }
}

void draw_image(Point p, const short *image, int cx, int cy, int width, int height)
{
   for (int x = width / 2 - cx / 2; x < width / 2 + cx / 2; x++)
   {
      for (int y = height / 2 - cy / 2; y < height / 2 + cy / 2; y++)
      {
         int xpos = p.x + x - width / 2;
         int ypos = p.y + y - height / 2;

         short clr = image[y * width + x];

         // printf("%x\n", clr);
         if (clr == 0xffffabcd)
            continue;

         plot_pixel(xpos, ypos, clr);
      }
   }
}

void draw_line(Point p0, Point p1, int short clr)
{
   int x0 = p0.x;
   int y0 = p0.y;
   int x1 = p1.x;
   int y1 = p1.y;
   char isSteep = abs(y1 - y0) > abs(x1 - x0);

   if (isSteep)
   {
      swap(&x0, &y0);
      swap(&x1, &y1);
   }

   if (x0 > x1)
   {
      swap(&x0, &x1);
      swap(&y0, &y1);
   }

   int dx = x1 - x0;
   int dy = abs(y1 - y0);

   int err = -(dx / 2);

   int y = y0;

   int yStep = -1;
   if (y < y1)
      yStep = 1;

   for (int x = x0; x <= x1; x++)
   {
      if (isSteep)
         plot_pixel(y, x, clr);
      else
         plot_pixel(x, y, clr);

      err += dy;

      if (err > 0)
      {
         y += yStep;
         err = err - dx;
      }
   }
}

