void popPixel()
{

   // Decrement counter
   arrListOfPixels[buff].count--;

   // Advance head
   Pixel *next = arrListOfPixels[buff].head->next;

   // Free memory
   free(arrListOfPixels[buff].head);

   arrListOfPixels[buff].head = next;
}

void pushPixel(Pixel p)
{
   // Allocate memory for new items
   Pixel *newP = (Pixel *)malloc(sizeof(Pixel));
   newP->x = p.x;
   newP->y = p.y;
   newP->clr = p.clr;
   newP->next = NULL;

   if (arrListOfPixels[buff].count == 0)
   { // empty
      arrListOfPixels[buff].head = arrListOfPixels[buff].tail = newP;
   }
   else
   {
      // Add item to tail
      arrListOfPixels[buff].tail->next = newP;
      arrListOfPixels[buff].tail = newP;
   }

   arrListOfPixels[buff].count++;
}

void popAud()
{

   // Decrement counter
   audOutFIFO.count--;

   // Advance head
   AudData *next = audOutFIFO.head->next;

   // Free memory
   free(audOutFIFO.head);

   audOutFIFO.head = next;
}

void pushAud(AudData data)
{
   // Allocate memory for new items
   AudData *newData = (AudData *)malloc(sizeof(AudData));
   newData->value = data.value;
   newData->next = NULL;

   if (audOutFIFO.count == 0)
   { // empty
      audOutFIFO.head = audOutFIFO.tail = newData;
   }
   else
   {
      // Add item to tail
      audOutFIFO.tail->next = newData;
      audOutFIFO.tail = newData;
   }

   audOutFIFO.count++;
}

