Point projectToScreen(Point p)
{
   Point vec = {p.x, p.y, p.z};

   // Project vector onto normal
   int project = (int)dotProduct(vec, screen_normal);
   vec.z -= project;

   return vec;
}

float dotProduct(Point vec1, Point vec2)
{
   return vec1.x * vec2.x + vec1.y * vec2.y + vec1.z * vec2.z;
}

Point rotatePoint(Point p, float yaw, float roll, float pitch)
{
   float a = yaw;   // Alpha
   float b = pitch; // Beta
   float y = roll;  // Gamma

   float x_new = cos(a) * cos(b) * p.x +
                 (cos(a) * sin(b) * sin(y) - sin(a) * cos(y)) * p.y +
                 (cos(a) * sin(b) * cos(y) + sin(a) * sin(y)) * p.z;

   float y_new = sin(a) * cos(b) * p.x +
                 (sin(a) * sin(b) * sin(y) + cos(a) * cos(y)) * p.y +
                 (sin(a) * sin(b) * cos(y) - cos(a) * sin(y)) * p.z;

   float z_new = -sin(b) * p.x +
                 cos(b) * sin(y) * p.y +
                 cos(b) * cos(y) * p.z;

   Point newPoint = {(int)x_new, (int)y_new, (int)z_new};

   return newPoint;
}

Point relToOrigin(Point p)
{
   p.x -= origin.x;
   p.y -= origin.y;
   p.z -= origin.z;

   return p;
}

Point mapPoint(Point p, float yaw, float roll, float pitch)
{
   // printf("Org: %d, %d, %d \n", p.x, p.y, p.z);

   Point vecToOrigin = relToOrigin(p);
   // printf("Rel: %d, %d, %d \n", vecToOrigin.x, vecToOrigin.y, vecToOrigin.z);

   Point rotated = rotatePoint(vecToOrigin, yaw, roll, pitch);
   // printf("Rot: %d, %d, %d \n", rotated.x, rotated.y, rotated.z);

   Point reMapped = {rotated.x + origin.x, rotated.y + origin.y, rotated.z + origin.z};
   // printf("Rem: %d, %d, %d \n", reMapped.x, reMapped.y, reMapped.z);

   Point projected = projectToScreen(reMapped);
   // printf("Prj: %d, %d, %d \n", projected.x, projected.y, projected.z);
   return projected;
}

