Point rotateAboutAxis(Point p, Point rotationAxis, float angle)
{
   float c = cos(angle);
   float s = sin(angle);
   float t = 1 - c;
   float x = rotationAxis.x, y = rotationAxis.y, z = rotationAxis.z;
   float rotationMatrix[3][3] = {
       {t * x * x + c, t * x * y - z * s, t * x * z + y * s},
       {t * x * y + z * s, t * y * y + c, t * y * z - x * s},
       {t * x * z - y * s, t * y * z + x * s, t * z * z + c}};

   float xNew = rotationMatrix[0][0] * p.x + rotationMatrix[0][1] * p.y + rotationMatrix[0][2] * p.z;
   float yNew = rotationMatrix[1][0] * p.x + rotationMatrix[1][1] * p.y + rotationMatrix[1][2] * p.z;
   float zNew = rotationMatrix[2][0] * p.x + rotationMatrix[2][1] * p.y + rotationMatrix[2][2] * p.z;

   Point newP = {xNew, yNew, zNew};

   // printf("Angle: %f\n", angle);
   // printf ("(%f, %f, %f) -> (%f, %f, %f)\n", p.x, p.y, p.z, newP.x, newP.y, newP.z);

   return newP;
}

void writeText(int x, int y, char *text, int size, enum TextAlign align)
{

   if (x < 0 || x >= 80 || y < 0 || y >= 60)
      return;

   if (align == RIGHT)
      x -= size;
   else if (align == CENTER)
      x -= size / 2;

   int offset = (y << 7) + x;
   while (*text)
   {
      *(charBase + offset) = *text;
      text++;
      offset++;
   }
}

